#index-content .content-to-top {
  position: fixed;
  bottom: 80px;
  right: 80px;
}
#index-content .my-nav {
  position: fixed;
  top: 0;
  width: 100%;
  z-index: 2000;
}
#index-content .goto-notice {
  text-align: center;
}
#index-content .goto-notice .goto-admin {
  text-decoration: underline;
  color: #00f;
  line-height: 40px;
}
#index-content .all-content {
  width: 1100px;
  min-height: 800px;
  margin: 0 auto;
  display: flex;
  align-items: flex-start;
}
#index-content .all-content .left-content {
  width: 768px;
  margin-right: 20px;
  min-height: 200px;
}
@media screen and (max-width: 1118px) {
  .content-to-top {
    bottom: 50px;
    right: 20px;
  }
  #index-content .all-content {
    width: 100%;
  }
  #index-content .all-content .left-content {
    width: 100%;
    margin: 0;
    padding: 0 16px;
  }
}
